import {Box} from "@mui/material";
import CardIterativeDesign
    from "./projects/IterativeDesign/CardIterativeDesign";

interface ProjectCardProps {
    index: number
}

export default function ProjectCard(props: ProjectCardProps) {
    let project;

    switch (props.index) {
        case 0:
            project = <CardIterativeDesign/>
            break;
        default:
            project =
                <Box>
                    Not Implemented yet
                </Box>
    }
    return project;
}
